    false,nt"url": null,nt"notes": "TASK NAME: NRCS Maine 0.7M NPS LIDAR LiDAR
    Data Acquisition and Processing Production Task USGS Contract No. G10PC00057 Task
    Order No. G13PD00954 Woolpert Order No. 073683 CONTRACTOR: Woolpert, Inc. This data
    set is LiDAR point cloud data, which encompasses approximately 2279 square miles
    along with a 100 meter buffer in two separate areas within Southwest Maine. LiDAR
    data is a remotely sensed high resolution elevation data collected by an airborne
    platform. The LiDAR sensor uses a combination of laser range finding, GPS positioning,
    and inertial measurement technologies. The LiDAR systems collect data point clouds
    that are used to produce highly detailed Digital Elevation Models (DEMs) of the
    earth's terrain, man-made structures, and vegetation. The task required the LiDAR
    data to be collected at a nominal pulse spacing (NPS) of 0.7m. The final products
    include 2870 files containing classified LAS, one (1) meter pixel raster DEMs of
    the bare-earth surface in ERDAS IMG Format, and 8-bit intensity images. Each LAS
    file contains lidar point information, which has been calibrated, controlled, and
    classified. Additional deliverables include hydrologic breakline data, control data,
    tile index, lidar processing and survey reports in PDF format, FGDC metadata files
    for each data deliverable in .xml format, and LAS swath data. Collected swath files
    that were that were larger than 2GB were provided in multiple sub-swath files, each
    less than 2GB. Ground conditions: Water at normal levels; no unusual inundation;
    no snow; leaf off.",nt"license_title": null,nt"extras": [{ntt"key":
